    const inputValue = e.srcElement.value.replaceAll('.', '').replaceAll(',', '.');
    this.value = parseInt(inputValue).toLocaleString('de-DE', { maximumFractionDigits: 2, minimumFractionDigits: 0 });
    console.log(e.srcElement.value);
